con:config.script:
String nextNumber = testRunner.testCase.getPropertyValue("NextNumber")

/*
 * Given a positive integer less than 100000000, appends a check digit according to the
 * algorithm used by the API.
 */
int addChecksum(int num) {
    assert num > 0 && num < 100000000
    int[] weights = [8,6,4,2,3,5,9,7]
    int tmp = num;
    int sum = 0;
    for (int i = 0; i < 8; i++) {
      sum += (tmp % 10) * weights[7-i];
      tmp /= 10;
    }
    sum %= 11;
    int checksum;
    switch (sum) {
    case 0:
      checksum = 5;
      break;
    case 1:
      checksum = 0;
      break;
    default:
      checksum = 11 - sum;
    }
    return num * 10 + checksum;
}

/*
 * Creates a string of the specified length, representing num padded with leading zeroes.
 */
String padWithZeroes(int num, int length) {
	StringBuilder result = new StringBuilder();
	for (int i = 0; i < length - (""+num).length(); i++) {
		result.append("0");
	}
	result.append(""+num);
	return result.toString();
}

/*
 * Given the specified prefix, eight-digit number and postfix, obtains a check digit
 *  and constructs a barcode.
 */
String getBarcode(String prefix, String postfix, int firstEight) {
  assert prefix.length() == 2;
  assert postfix.length() == 2;
  return prefix + padWithZeroes(addChecksum(firstEight), 9) + postfix;
}

int rangeStart = Integer.valueOf(testRunner.testCase.getPropertyValue("RangeStart"))
int rangeEnd = Integer.valueOf(testRunner.testCase.getPropertyValue("RangeEnd"))

String barcodes = "["
String rangePrefix = testRunner.testCase.getPropertyValue("RangePrefix")
String rangePostfix = testRunner.testCase.getPropertyValue("RangePostfix")
for (int i = rangeStart; i < rangeEnd; i++) {
	barcodes += getBarcode(rangePrefix, rangePostfix, i) + (i+1 < rangeEnd ? "," : "")
}
barcodes += "]"
testRunner.testCase.setPropertyValue("Barcodes", barcodes);

/*
 * If request is successful, change rangeStart to the next in the sequence
 */

String padWithZeroes(int num) {
	int length = Integer.valueOf(testRunner.testCase.getPropertyValue("RangeStart").length())
	StringBuilder result = new StringBuilder();
	for (int i = 0; i < length - (""+num).length(); i++) {
		result.append("0");
	}
	result.append(""+num);
	return result.toString();
}

if (Boolean.valueOf(testRunner.testCase.getPropertyValue("RequestSucceeded"))) {
  int rangeStart = Integer.valueOf(testRunner.testCase.getPropertyValue("RangeStart"))
  int nextNum = Integer.valueOf(testRunner.testCase.getPropertyValue("NextNumber"))
  testRunner.testCase.setPropertyValue("RangeStart", padWithZeroes(Math.max(rangeStart, nextNum))) 
}

int i = Integer.valueOf(testRunner.testCase.getPropertyValue("CreatedShipments"))
testRunner.testCase.setPropertyValue("CreatedShipments", "" + ++i)
int max = Integer.valueOf(testRunner.testCase.getPropertyValue("ShipmentsToCreate"))
if (i < max) {
	testRunner.gotoStepByName("Create shipment")
}

